import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file with different approach
    await page.goto(fileUrl, { waitUntil: 'domcontentloaded' });
    await page.waitForSelector('body', { timeout: 5000 });

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Extract data from script content
    const scriptContent = await page.$eval('script', el => el.textContent);

    // Extract product data using different selector approach
    const productData = await page.$$eval('a[href*="#"]', anchors => 
      anchors.map(a => ({
        text: a.textContent.trim(),
        href: a.href
      }))
    );

    // Extract input fields and buttons
    const inputFields = await page.$$eval('input, select, button', elements => 
      elements.map(el => ({
        type: el.tagName.toLowerCase(),
        id: el.id || 'none',
        className: el.className || 'none',
        placeholder: el.placeholder || 'none'
      }))
    );

    // Extract category information
    const categories = await page.$$eval('.category-card, .nav-menu', elements => 
      elements.map(el => el.textContent.trim())
    );

    // Take screenshot after data extraction
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_data_extracted.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_data_extracted.png'));

    return {
      success: true,
      action: "Extracted product links, form elements, and category data from Amazon simulation",
      extractedData: {
        productLinks: productData,
        formElements: inputFields,
        categories: categories,
        scriptContentLength: scriptContent.length
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete data extraction task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
